import React from "react";
import { NavigationBar } from "../components/navBar/Navbar";
import { Footer } from "../components/footer/Footer";

export const MainLayout = ({ children }) => {
  return (
    <>
      <NavigationBar />
      {children}
      <Footer />
    </>
  );
};
